import { useState }  from 'react';
const axios = require('axios');

function App() {
  const [todos, setTodos] = useState(["default"])
  var data = axios.get('/api')
  .then(function (response) {
    // handle success
    // return response.data
    const [todos, setTodos] = useState([response.data])
    console.log(response.data);
  })
  .catch(function (error) {
    // handle error
    console.log(error);
  })
  .then(function () {
    // always executed
  });
  console.log(data)
  function addToDo() {
    var todo = document.getElementById("form").value

    if(todo !== "") {
      setTodos((currTodos) => [...currTodos, todo])
    }
    document.getElementById("form").value = ""
  }
  return (
    <div className="App">
      {/* <Form todos={todos} addToDo={addToDo}/>
      {todos.map(todo => <h1>{todo}</h1>)} */}
    </div>
  );
}

export default App;
